import { Subject } from 'rxjs';
import * as i0 from "@angular/core";
export class GamesCatalogueService {
    constructor() {
        this.games$ = new Subject();
    }
    getGames$() {
        return this.games$.asObservable();
    }
    async load() {
        const games = [];
        games.push(new Game("4 en l√≠nea", "Intenta formar una linea de 4 fichas del mismo color ya sea en horizontal, vertical o diagonal", ""));
        this.games$.next(games);
    }
}
